import React from "react";
import Home from "./pages/home/home"; 

const AppLin = () => {
  return (
    <section className="App">
      <Router>
        <Link to="/">Home</Link>
        <Route path="/" component={Home} />
      </Router>
    </section>
  );
};

function App() {
  return (
   <Home />

  );
}

export default App;
